tinymce.PluginManager.requireLangPack("mc_news");tinymce.PluginManager.add("mc_news",(function(editor,url){editor.ui.registry.addIcon("news",'<svg width="24" height="24"><use xlink:href="/'+baseadmin+'/template/img/tinymce/mc_icons.svg#news"></use></svg>');function showDialog(){editor.windowManager.openUrl({title:"mc_news Title",url:tinyMCE.baseURL+"/plugins/mc_news/news.php",width:800,height:550,inline:1,resizable:true,maximizable:true})}editor.ui.registry.addButton("mc_news",{icon:"news",tooltip:"mc_news Title",onAction:()=>{_api=showDialog()},onSetup:buttonApi=>{const editorEventCallback=eventApi=>buttonApi.setEnabled(eventApi.element.nodeName==="IMG");editor.on("NodeChange",editorEventCallback);return buttonApi=>editor.off("NodeChange",editorEventCallback)}})}));